The client is the main utility of Hop. It is an asynchronous client that abstracts away the request and response parsing. It supports creating an "in-memory" client that runs an instance of the engine within it, and also supports connecting to a server instance and running requests through it. Here's a quick example of using a client to fire up a local Hop engine, increment a key, and then decrementing it again: use hop::Client; let client = Client::memory();
println!("New value: {}", client.increment("foo").await?); // value is 1
println!("New value: {}", client.decrement("foo").await?); // value is 0 Source code : https://github.com/hopdb/hop/tree/master/client Issue tracker : @hopdb/hop/issues/crate: client
